        _;
    }

    // Check that the ape rate is between min and max bet
    modifier choiceInRange(uint256 _choice) {
        require(
            _choice >= rangeMin + padding,
            "DiceRoll: Incorrect value for choice"
        );
        require(
            _choice <= rangeMax + padding,
            "DiceRoll: Incorrect value for choice"
        );
        _;
    }

    modifier uniqueSeed(bytes32 _seed) {
        require(games[_seed].id == 0, "DiceRoll: Seed already used");
        _;
    }

    function multiplier(bool _over, uint256 _choice)
        public
        view
        returns (int128)
    {
        uint256 winRangeLength = _over ? rangeMax - _choice + 1 : _choice;
        uint256 rangeLength = rangeMax - rangeMin + 1;
        int128 winChance = ABDKMath64x64.mul(
            ABDKMath64x64.div(
                ABDKMath64x64.fromUInt(winRangeLength),
                ABDKMath64x64.fromUInt(rangeLength)
            ),
            ABDKMath64x64.fromUInt(uint256(100))
        );

        return
            ABDKMath64x64.div(
                ABDKMath64x64.fromUInt(uint256(100).sub(edge)),
                winChance
            );
    }

    function payout(
        bool _over,
        uint256 _choice,
        uint256 _bet
    ) public view returns (uint256) {
        return ABDKMath64x64.mulu(multiplier(_over, _choice), _bet);
    }

    function play(
        uint256 _choice,
        bool _over,
        bytes32 _seed
    ) public payable betInRange choiceInRange(_choice) uniqueSeed(_seed) {
        uint256 possiblePrize = payout(_over, _choice, msg.value);
        if (possiblePrize > maxPayout) {
            possiblePrize = maxPayout;
        }

        require(
            possiblePrize < address(this).balance,
            "DiceRoll: Insufficent funds on contract to cover the bet"
        );

        totalGamesCount++;
        Game storage game = games[_seed];

        game.id = totalGamesCount;
        game.player = payable(msg.sender);
        game.bet = msg.value;
        game.choice = _choice;
        game.state = GameState.PENDING;
        game.over = _over;

        houseProfitEther = houseProfitEther + int256(game.bet);
        listGames.push(_seed);

        emit GameCreated(game.player, game.bet, game.choice, _seed, game.over);
    }

    function confirm(
        bytes32 _seed,
        uint8 _v,
        bytes32 _r,
        bytes32 _s
    ) public onlyCroupier returns (address) {
        Game storage game = games[_seed];

        require(game.id != 0, "DiceRoll: Game doesn't exist");
        require(
            game.state == GameState.PENDING,
            "DiceRoll: Game already played"
        );

        // require(
        //     ecrecover(prefixedHash, _v, _r, _s) == croupier,
        //     "DiceRoll: Invalid signature"
        // );

        game.result = (uint256(_s) % 10000) + 1;
        int128 _multiplier = multiplier(game.over, game.choice);

        if (
            (!game.over && (game.choice >= game.result)) ||
            (game.over && (game.choice <= game.result))
        ) {
            game.prize = payout(game.over, game.choice, game.bet);

            if (game.prize > maxPayout) {
                game.prize = maxPayout;
            }
            game.player.transfer(game.prize);
            houseProfitEther = houseProfitEther - int256(game.prize);
            game.state = GameState.WON;
        } else {
            game.prize = 0;
            game.state = GameState.LOST;
        }

        emit GamePlayed(
            game.player,
            game.id,
            ABDKMath64x64.toUInt(_multiplier),
            game.bet,
            game.prize,
            game.choice,
            game.result,
            _seed,
            game.over,
            game.state
        );
    }

    function setChoiceRange(
        uint256 _min,
        uint256 _max,
        uint256 _padding
    ) public onlyOwner {
        rangeMin = _min;
        rangeMax = _max;
        padding = _padding;
    }

    function setEdge(uint8 _e) public onlyOwner {
        edge = _e;
    }

    function setmaxPayout(uint256 _ether) public onlyOwner {
        maxPayout = _ether;
    }

    function setBetRange(uint256 min, uint256 max) public onlyOwner {
        minBet = min;
        maxBet = max;
    }

    function setCroupier(address addr) public onlyOwner {
        croupier = addr;
    }

    function setProfitTaker(address _profitTaker) public onlyOwner {
        profitTaker = _profitTaker;
    }

    function takeProfit() public onlyProfitTaker {
        if (houseProfitEther > 0) {
            payable(profitTaker).transfer(uint256(houseProfitEther));
            houseProfitEther = 0;
        }
    }

    function withdrawFunds() public onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    // Fallback function
    fallback() external payable {}

    receive() external payable {}
}
